using System;
using System.Collections.Generic;
using System.IO;
using System.Linq;
using Business.Services.ConvertPdfService.Abstract;
using Entities.Concrete;
using iTextSharp.text.pdf;
using iTextSharp.text;
using System.IO.Compression;

namespace Business.Services.ConvertPdfService.Concrete
{
    public class ConvertPdfService : IConvertPdfService
    {
        public byte[] GeneratePdf(IEnumerable<BanuLog> logs, int partNumber, string date)
        {
            using (var memoryStream = new MemoryStream())
            {
                var document = new Document(PageSize.A3);
                PdfWriter.GetInstance(document, memoryStream);
                document.Open();

                BaseFont baseFont = BaseFont.CreateFont("Helvetica", "CP1254", BaseFont.NOT_EMBEDDED);
                var titleFont = new Font(baseFont, 16, Font.BOLD); 
                var bodyFont = new Font(baseFont, 12); 

                
                    byte[] imageBytes = Convert.FromBase64String(""); // Base64'ten byte dizisine çevir
                    var image = Image.GetInstance(imageBytes); 

                    
                    image.ScaleToFit(200f, 200f); 
                    image.Alignment = Element.ALIGN_CENTER;
                    document.Add(image); 
                

                document.Add(new Paragraph($"Bandırma 17 Eylül Üniversitesi Misafir Takip Sistemi - {date.Replace("-","/")} Tarihli Kayıtlar (Part - {partNumber})", titleFont));
                document.Add(new Paragraph("\n"));

                var table = new PdfPTable(4) { WidthPercentage = 100 };

                table.AddCell(new PdfPCell(new Phrase("İşlem Yapan Kişi", titleFont)) { HorizontalAlignment = Element.ALIGN_CENTER });
                table.AddCell(new PdfPCell(new Phrase("İşlem Açıklaması", titleFont)) { HorizontalAlignment = Element.ALIGN_CENTER });
                table.AddCell(new PdfPCell(new Phrase("İşlem Tipi", titleFont)) { HorizontalAlignment = Element.ALIGN_CENTER });
                table.AddCell(new PdfPCell(new Phrase("İşlem Tarihi", titleFont)) { HorizontalAlignment = Element.ALIGN_CENTER });

                foreach (var log in logs)
                {
                    table.AddCell(new PdfPCell(new Phrase(log.TransactorFullName, bodyFont)) { HorizontalAlignment = Element.ALIGN_CENTER });
                    table.AddCell(new PdfPCell(new Phrase(log.TransactionsDescription, bodyFont)) { HorizontalAlignment = Element.ALIGN_LEFT });
                    table.AddCell(new PdfPCell(new Phrase(log.TransactionType, bodyFont)) { HorizontalAlignment = Element.ALIGN_CENTER });
                    table.AddCell(new PdfPCell(new Phrase(log.CreatedDate.ToString("yyyy-MM-dd HH:mm:ss"), bodyFont)) { HorizontalAlignment = Element.ALIGN_CENTER });
                }

                document.Add(table);
                document.Close();

                return memoryStream.ToArray();
            }
        }

        public byte[] GenerateZipWithPdfs(List<List<BanuLog>> logGroups, string date)
        {
            using (var memoryStream = new MemoryStream())
            {
                using (var zipArchive = new ZipArchive(memoryStream, ZipArchiveMode.Create, true))
                {
                    for (int i = 0; i < logGroups.Count; i++)
                    {
                        var pdfBytes = GeneratePdf(logGroups[i], i + 1, date);
                        var pdfFileName = $"BanuLogs_{date}_Part{i + 1}.pdf";

                        var zipEntry = zipArchive.CreateEntry(pdfFileName, CompressionLevel.Fastest);
                        using (var entryStream = zipEntry.Open())
                        {
                            entryStream.Write(pdfBytes, 0, pdfBytes.Length);
                        }
                    }
                }

                return memoryStream.ToArray();
            }
        }

        public List<List<BanuLog>> SplitLogs(IEnumerable<BanuLog> logs, int batchSize)
        {
            var logList = logs.ToList();
            var result = new List<List<BanuLog>>();

            for (int i = 0; i < logList.Count; i += batchSize)
            {
                result.Add(logList.GetRange(i, Math.Min(batchSize, logList.Count - i)));
            }

            return result;
        }
    }
}
